def similarity(t1,t2):
    sim = 0
    if t1[2]==t2[1]: #same day of week
        sim +=1
    if t1[5]==t2[6]: #same promo
        sim +=2
    if t1[6]==t2[7]: #same holiday
        sim +=2
    if t1[7]==t2[8]: #same school holiday
        sim +=2
    s1 = store[int(t1[1])]
    s2 = store[int(t2[0])]

    if s1[1]==s2[1]: #same store type
        sim +=2
    if s1[2]==s2[2]: #same store assort
        sim +=2
    if s1[6]==s2[6]: #same promo2
        sim +=2

    if t1[4]!=t2[5]: #one open the other not
        sim=-1

    return sim

k=5

def insertIfSimEnough(obj,nearest):
    if len(nearest)<k:
        nearest.append(obj)
    else:
        for n in nearest:
            if obj["sim"]>n["sim"]:
                nearest.remove(n)
                nearest.append(obj)
                break

def mean(array):
    sum=0
    for e in array:
        sum += e["value"]

    return float(sum)/len(array)

def alreadyHaveSim(t1):
    s1 = store[int(t1[1])]
    if (t1[2],t1[5],t1[6],t1[7],s1[1],s1[2],s1[6]) in savedSimilarities.keys():
        return True
    else:
        return False

